            // gender :props.propObj.gender,
            // skills :props.propObj.skills,
            // tools :props.propObj.tools,
            // domain :props.propObj.domain,
            // experience :props.propObj.experience
        
    }
    render(){
        return (
            <div className="header">
                <img className="logo" src={logo} alt="not found"></img>
                Employee ID :- {this.state.employeeid} <br/>
                Employee Name :- {this.state.emoyeename} <br/>
                Employee Skills :- {this.state.skills} <br/>
                Gender :- {this.state.gender} <br/>
                Tools :- {this.state.tools} <br/>
                Domain :- {this.state.domain} <br/>
                Experience :- {this.state.experience} <br/>
                
            </div>
        )

    }
        
}
